('gen_random_uuid()', "6000", 2, 'Двухэтажный коттедж - гостевой дом "Сибирская Заимка" расположен в живописном месте, вдали от городской суеты - 12 км от города Томска в селе Коларово. Общая площадь коттеджа 100 м2. Внутри коттеджа и на прилегающей территории имеется все необходимое для полноценного отдыха. Приглашаем Вас отдохнуть душой и телом с семьей, друзьями, коллегами!', 3, 56.337112068377564, 84.95615549999998, '2022-10-13 13:23:29.086377+07', 'Tomsk', '~/img/Db/img/Entertainment/sibirZaimka/', 'Сибирская Заимка', 'http://xn--80aatfkl.xn--p1acf/'),
